import React from 'react';

const url = 'http://localhost:8080/users';


class User extends React.Component {
    /**
     * Конструктор компонента.
     * @param {*} props Свойства переданые в компонент.
     * @return {undefined}
     */
    constructor(props) {
        super(props);
        props.permissionActionGet(['Fuel']);
    }

    path: string;

    /**
     * Вывести список клиентов.
     * @return {*} Представление.
     */
    renderFuelList = () => (
        <Permission access="Couriers.Fuel.List">
            <FuelList baseUrl={this.path} />
            <FuelModal baseUrl={this.path} />
            <FuelSubscribe />
        </Permission>
    );

    /**
     * Отображение компонента
     * @return {*} Представление компонента.
     */
    render() {
        this.path = `${this.props.baseUrl}/fuel`;

        return (
            <Switch>
                <Route exact path={`${this.path}/:id/:action`} render={this.renderFuelList} />
                <Route exact path={`${this.path}/:action`} render={this.renderFuelList} />
                <Route exact path={this.path} render={this.renderFuelList} />
            </Switch>
        );
    }
}

export default User;
